// prettier-ignore
function toResult(
    proof: string,
    merkleRoot: string,
    nullifierHash: string,
    verificationLevel: string
) {
    return {
        proof: proof,
        merkle_root: merkleRoot,
        nullifier_hash: nullifierHash,
        verification_level: verificationLevel
    };
}

